import React, { useEffect, useState, useContext } from "react";
import { Container, Row, Col, Table, Spinner, Modal } from "react-bootstrap";
import SideBar from "../SideBar/SideBar";
import "./DashBoard.css";
import { DataContext } from "../Data";
import Hamburger from "../Hamburger/Hamburger";
import { Helmet } from "react-helmet";
const DashBoard = () => {
  const [firstname, setFirstname] = useState("");
  const [age, setAge] = useState(10);
  const [email, setEmail] = useState("");
  const [phoneNumber, setphoneNumber] = useState("");

  return (
    <Container fluid className="dashboard">
      <Helmet>
        <title>Dashboard | Doctors Portal</title>
        <meta name="description" content="Now a days All things are based on Online. Find a good doctor is so  much hassle  now a days.
        Doctors portal is going to give you advantage that you don't need to go hospital physically.You can book and get the best treatment from now ."/>
        <meta name="keywords" content="online doctors book appointment"/>
      </Helmet>
      <div className="ml-6 main">
        <div className="d-md-block">
          <SideBar></SideBar>
        </div>
        <div className="title__hamburger">
          <h3 className="mt-3">DashBoard</h3>
          <Hamburger></Hamburger>
        </div>

        <img src={"docter/docter_welcome.svg"}/>

        <div>
          {/*<form>*/}
          <text>How are you feeling today?</text>
          <input
              type='text'
              name='firstname'
              value={firstname}
              onChange={e => setFirstname(e.target.value)}
          />
          <br/>
          <p>Enter his Age:</p>
          <input
              type='text'
              name='age'
              value={age}
              onChange={e => setAge(e.target.value)}
          />
          <br/>
          <p>Enter parents Email:</p>
          <input
              type='text'
              name='email'
              value={email}
              onChange={e => setEmail(e.target.value)}
          />
          <br/>
          <p>Enter parents PhoneNumber:</p>
          <input
              type='text'
              name='phoneNumber'
              value={phoneNumber}
              onChange={e => setphoneNumber(e.target.value)}
          />
          <br/>
          <button onClick={e=> handleSubmitButtonCLick(e)}>Submit</button>
          {/*</form>*/}
        </div>
      </div>

    </Container>
  );
};

export default DashBoard;
